const [results, setResults] = useState([])

const GetMovieData = () => {
  fetch("http://localhost:8081/api/leffat")
    .then((results) => {
      return results.json();
    })
    .then((data) => {
      console.log(data);
      const items = data;

      setResults(items)
    });
};
